  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:18.519557\",\n\t\"name\": \"stillwater-wildlife-management-area-annual-narrative-report-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Fallon, Stillwater and Anaho Island
  National Wildlife Refuges are located in northwest Nevada and are administered by
  the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
  Wildlife Management Area (SWMA). The weather in 1981 was average or above, but precipitation
  continued well below average since the fall of 1980. The 30 year old trapping plan
  was replaced with a new Fur Management Plan. The 20 year old grazing plan was amended
  with the production of a Grasslands Management Plan/Proposal for the North Marsh
  Unit. For the second year in a row, the Aquatic Vegetation Survey was performed
  as practiced prior to 1975. There had been a tremendous response by aquatic vegetation
  to increased water in 1979 and 1980. Grazing practices were better monitored and
  controlled resulting in healthier habitat. 1981, however was one of the poorest
  water and weather years in recent history and cattle suffered.  Wildlife diversity
  was quite good. Many ponds were drying up so shorebirds were quite abundant. Despite
  abundant water in 1980 and u201cenoughu201d in 1981, waterfowl use was not as much
  as expected.  After fighting to provide habitat, we find ourselves with not enough
  ducks still alive in flyway to utilize what habitat we have. The Refuge portion
  of the SWMA is closed to hunting.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
